        return new Source("{% extends 'base.html.twig' %}



{% block title %}Log in!{% endblock %}

{% block stylesheets %}
    <link href=\"{{asset('css/login.css') }}\" type=\"text/css\" rel=\"stylesheet\" />
{% endblock %}

{% block body %}
<div class=\"img_top_logo\">
    <img src=\"https://upload.wikimedia.org/wikipedia/commons/b/b2/Campingazlogo.jpg\" alt=\"l'image charge\">
</div>
<form method=\"post\">
    {% if error %}
        <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
    {% endif %}

    {#{% if app.user %}
          <div class=\"mb-3\">
            You are logged in as {{ app.user.userIdentifier }}, <a href=\"{{ path('app_logout') }}\">Logout</a>
        </div>
    {% endif %}
    #}
    <div id=\"title_connexion\">
        <h1>Connexion</h1>
    </div>
    <div id=\"form_write\">
        <input type=\"text\" value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" class=\"form-control\" autocomplete=\"email\" required autofocus>
        <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" autocomplete=\"current-password\" required>
        <input type=\"hidden\" name=\"_csrf_token\" value=\"{{ csrf_token('authenticate') }}\">
        <button class=\"btn btn-lg btn-primary\" type=\"submit\">Se connecter</button>
    </div>

    {#
        Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.
        See https://symfony.com/doc/current/security/remember_me.html

        <div class=\"checkbox mb-3\">
            <label>
                <input type=\"checkbox\" name=\"_remember_me\"> Remember me
            </label>
        </div>
    #}
</form>
<div id=\"container\">
    
</div>
{% endblock %}
